INSERT INTO `changelogs` (`id`, `version`, `changes`, `triggered_by`, `date_time`) VALUES
(5, '2.0.1', 'Ajout système de ChangeLog\nModification de l arboressance des fichiers du site\nMode Sombre (bientôt)', 'Fichiers Développeur', '2024-11-20 13:16:29'),
(6, '2.0.2', 'Ajouts du mode Sombre', 'Fichiers Développeur', '2024-11-20 15:07:38'),
(8, '2.0.3', 'Correction de bug /ajout/ qui fait une 404 sur l annuaire\nCorrection de bug /fnpc/ajout/ qui fait une 404 sur l annuaire', 'FICHIERS Développeur', '2024-11-28 21:06:31'),
(9, '2.0.4', 'Ajout du mot de passe oublié', 'FICHIERS Développeur', '2024-11-30 17:08:18'),
(10, '2.0.5', 'Ajout du système de validation et de modification d accreditation pour les :\n- Chefs OPJ PN\n- Direction PN\n\n(Si la GN souhaite ce même système, veuillez vous manifester.)', 'FICHIERS Développeur', '2024-12-08 12:54:13'),
(11, '2.0.6', '!! Grosse MAJ !!\n\nSuite a l ajout de la plaque d imatriculation persistente a chaque citoyens, le SIV est entrain d être développé.', 'FICHIERS Développeur', '2024-12-08 13:43:16'),
(12, '2.1.0', 'GROSSE MAJ !\r\n\r\nLe SIV est enfin là !', 'FICHIERS Développeur', '2024-12-13 13:09:08'),
(13, '2.1.1', 'Correction du SIV\r\nAjout de la propriété (véhicule entreprise) dans le SIV (Entreprise légale uniquement)', 'FICHIERS Développeur', '2024-12-31 13:17:30'),
(14, '2.1.2', 'Refonte du FNPC !\r\n\r\nModification totale du FNPC:\r\n- Ajout de Fiche FNPC en recherchant des joueurs directement sur le serveur\r\n- 1 Fiche unique par identité\r\n- Un système pour relever des Infractions avec un système de points et de status de permis\r\n\r\nVoilà je vous laisse découvrir par vous même', 'Kertie LeDéveloppeur', '2025-01-23 18:43:29'),
(15, '2.1.3', 'Modification du FNPC (encore)\n\nMaintenant, plus besoin de rajouter les personne au FNPC elle y sont automatiquement,\n\nLa Prefeture peut Annuler et Valider les permis et Prolonger les suspensions.\n\nQuand un permis est validé alors il retourne a 3 pts.\n\nAjout du Formulaire reCaptcha pour éviter les bots (on sait jamais)\n\nModification de l\'arrière plan de la page de connexion, enregistrement et mot de passe oublié', 'Kertie LeDéveloppeur', '2025-02-12 16:16:26'),
(16, '2.1.4', 'Modification de la barre de Navigation\r\n\r\nModification du Pieds de Page', 'Arman Luly', '2025-02-17 16:25:50'),
(17, '2.1.5', 'Correction du TAJ (désolé de vous avoir fait patienter)', 'Arman Luly', '2025-03-03 20:42:32'),
(18, '2.1.6', 'Optimisation des requêtes afin d’améliorer la rapidité de chargement des fichiers.\r\n\r\nDe nouvelles fonctionnalités arriveront très prochainement ! Restez connectés.', 'Arman Luly', '2025-03-04 19:18:10');
